text: |
  What is the output of the following code?

  ```python
  items = ['Yeezy', 'Ultraboost']

  print(items * 2)
  ```
options:
  - "`['Yeezy', 'Yeezy', 'Ultraboost', 'Ultraboost']`"
  - "`['Yeezy', 'Ultraboost', 'Yeezy', 'Ultraboost']`[o]"
  - 'Python throws an error'
explanation: |
  `*` operator duplicates a list. Each duplicate is appended to the end of the list.
